import React from 'react';

const Signin = () => {
    return (
        <article className="flex flex-wrap pv3 ph4 ba b--black-30 br2 w-50-m w-25-l shadow-4 center">
            <form className="measure">
                <fieldset id="sign-up">
                    <legend className="white ph2" > Sign In: </legend>
                    <div className="form-group">
                        <label>Email</label>
                        <input type="email" name="email-address" id="email" />
                    </div>
                </fieldset>
            </form>
        </article>
    );
}

export default Signin
